from collections import defaultdict

def is_coprime_sortable(sequence, n=None):
    if n is not None:
        n = len(sequence)

    def primes(n):
        is_prime = [True] * (n + 1)
        is_prime[0] = is_prime[1] = False
        for i in range(2, int(n ** (1 / 2)) + 1):
            if is_prime[i]:
                for j in range(i * i, n + 1, i):
                    is_prime[j] = False
        return [i for i in range(n + 1) if is_prime[i]]
    prime_list = primes(100000)
    solvers = [[] for _ in range(100001)]
    for p in prime_list:
        for i in range(p, 100001, p):
            solvers[i].append(p)
    parent = [i for i in range(100001)]

    def find(x):
        if x == parent[x]:
            return x
        parent[x] = find(parent[x])
        return parent[x]
    for v in sequence:
        p_rep = find(min(solvers[v]))
        for s in solvers[v]:
            parent[find(s)] = p_rep
        parent[find(v)] = p_rep
    dic = defaultdict(set)
    for (i, v) in enumerate(sequence):
        dic[find(v)].add(i)
    sorted_sequence = sorted(sequence)
    for (i, v) in enumerate(sorted_sequence):
        if i not in dic[find(v)]:
            return 0
    return 1

